import React, { Component } from 'react';

import './App.css';




import {
    Link
}from 'react-router-dom';




class Header extends Component {
    render() {
        return(
            <div className="headerStyle">
                <header>
                    <h1>
                    RAGNA LEMONTREE 
                    </h1>
            <br/>
                    <p>
                        <Link to='/dates'>Daten</Link>
                            <br/>

                    </p>



                </header>
            </div>
        );
    }
}

export default Header;
